  expected_count: 5
  input: TEXT,F3XA,,"Due to the inability of the FECFile software to import Memo Text
    field contents, we have included earmarked transaction details in the 'Description'
    field for contributions to candidates in Schedules A and B. (This appears as 'Purpose
    of Disbursement' in Schedule B.) Since the Description field contents cannot exceed
    40 characters, we have had to keep the notes as concise as possible. To indicate
    that a contribution was earmarked and will be transferred in the form of a committee
    check, the abbreviation 'Comm.' is used. If the contributor wrote a check directly
    to the candidate and we simply forwarded the check, the abbreviation 'Cont.' is
    used. I spoke with Ken in the FEC Electronic Filing department, and he confirmed
    that this was acceptable.               Also regarding Oct 10, 2002 RQ-3 there
    is a question why earmarked contribtuions are not the same on Scedules A and B.  Madison
    Project follows FEC procedure and timelines.  At the end of the quarter however
    we recevied checks but they were not transmitted to the candidate until the next
    reporting period but within FEC timeline requirments.  Line 23 has also been corrected
    as requested.  Several contributions were inadvertently listed as unitemized."
